//       "<h1><b>VENTA DEPTO. 3 AMB. PUERTO MADERO - 3 COCHERAS</b></h1><br><p>Exclusivo Piso tipo Loft en Dúplex, desarrollado en dos plantas con espectacular vista al Dique y Puente de la Mujer. En medio de Puerto Madero se encuentra esta obra de arte. Con diseño y decoración de Philippe Starck, Norman Foster y Alan Faena.</p><br><h2><b>MEDIDA SEGÚN ESCRITURA 92,85 m2 PERO POR TRATARSE DE UN LOFT LA DISTRIBUCIÓN ESTÁ DE LA SIGUIENTE FORMA:</b></h2><br><h3><b>MEDIDAS PLANTA ALTA:</b></h3><br><ul><li>Cocina - Comedor - Living: 172,30 m2</li><li>Cuarto Principal: 63,65 m2</li><li>Baño Principal: 19 m2</li><li>Vestidor: 12 m2</li><li>Terraza: 61 m2</li><li>Balcón Semicubierto: 16 m2</li></ul><br><h3>PLANTA BAJA:</h3><br><ul><li>Loft: 70 m2</li><li>Cuarto con dos Vestidores: 44 m2</li><li>Baño Completo: 9,5 m2</li><li>Toilette: 4,90 m2</li><li>Gimnasio: 42 m2</li><li>Cocina Auxiliar: 21 m2</li><li>Pasillo: 25 m2</li></ul><p>Total Metros Cubiertos: 483 m2 Descubiertos: 61 m2 Semicubiertos: 16 m2</p><br><h2>Características del Departamento:</h2><br><ul><li>Ubicación: Dock 5</li><li>Orientación: Este</li><li>Triple Acceso: Puerta principal en planta baja, segundo acceso lateral con salida al Dique, tercer acceso por cochera privada.</li><li>Amplio estar con salida a balcón aterrazado.</li><li>Dormitorio Principal en Suite con gran vestidor, baño con bañera y ducha.</li><li>Segundo Dormitorio en Suite muy amplio con dos vestidores y baño completo.</li><li>Cocina comedor con salida a la terraza.</li><li>Toilette de Recepción.</li><li>Segunda cocina con lavadero independiente y baño completo.</li><li>Gimnasio.</li><li>Gran sala de estar o Playroom.</li><li>Refrigeración: Aire Acondicionado Central Frío/Calor.</li></ul><p>Incluye:</p><ul><li>3 Cocheras.</li><li>Cámaras de seguridad en su interior.</li></ul><h2>Amenities del Edificio:</h2><ul><li>Piscina Interior.</li><li>Sum</li><li>Sala de Reuniones</li><li>Gimnasio</li><li>Laundry</li><li>Grupo electrógeno.</li><li>Servicio de Vigilancia 24 horas.</li></ul><br><p>TE SUGIERO VER EL VIDEO PARA QUE PUEDAS APRECIAR ESTA ESPECTACULAR PROPIEDAD!!!</p><br><h2>Narración Descriptiva:</h2><br><p>Al adentrarse en este departamento diseñado por Alan Faena, conocido por su estilo único y su atención al detalle, nos encontramos con una espléndida vista panorámica al espejo de agua del Dique. Donde se puede contemplar el amanecer, así como las luces brillantes de la ciudad que se reflejan en el agua. Cada rincón refleja la elegancia y el lujo característicos del diseñador. La funcionalidad y la estética fueron creadas por el diseñador industrial francés Philippe Starck y el arquitecto británico Norman Foster. Los interiores y pisos están totalmente revestidos en madera de Lapacho, decorados con su distintiva paleta de colores cálidos y materiales de alta calidad, creando un ambiente sofisticado y acogedor. Los espacios están cuidadosamente diseñados para maximizar la vista.</p><br><p>Master suite con un amplio vestidor, baño con bañera y box de ducha en mármol de Carrara. Sector de living privado con salida a la peatonal. Tiene un balcón super privado con sol en gran parte del día y se puede disfrutar de la sombra que brindan los árboles. Cocina y comedor principal con salida a una amplia terraza lateral con deck y es donde se encuentran camuflados por vegetación natural, los equipos de calefacción y aire acondicionado. A través de la misma se puede salir a dar un paseo por la peatonal.</p><br><p>A través de una escalera caracol de vidrio accedemos al subsuelo donde la adaptabilidad se manifiesta con una amplia sala, totalmente revestida en mármol y espejos en sus paredes pudiendo funcionar como Playroom o sala de estar, toilette, segunda cocina con lavadero, y baño con ducha. Amplio dormitorio en suite con dos vestidores y baño completo totalmente revestido en mármol de Carrara.</p><br><p>Además, posee gimnasio.</p><p>El sector de salida cuenta con paredes revestidas en piedras y espejos, doble puerta con sistema de acceso digitalizado. Creando un ambiente elegante y moderno.</p><p>Este es verdaderamente un lugar donde el diseño y el lujo se fusionan para crear una experiencia de vida excepcional.</p><br><p>Contactanos y agendamos una visita. Vení a conocerlo!!!</p><br><p>Venta/permuta Dock 5 - En uno de los más lindos Docks de Puerto Madero</p>",
